import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import RestaurantOutlinedIcon from '@material-ui/icons/RestaurantOutlined';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import EmojiPeopleIcon from '@material-ui/icons/EmojiPeople';
import SupervisedUserCircleIcon from '@material-ui/icons/SupervisedUserCircle';
import FavoriteIcon from '@material-ui/icons/Favorite';
import { Avatar } from '@material-ui/core';
import { useSelector } from 'react-redux';
import { history } from '../../helpers/history';

const drawerWidth = 280;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
    zIndex: '0!important',
  },
  drawerContainer: {
    overflow: 'auto',
  },
  '@global': {
    '.MuiDrawer-paperAnchorDockedLeft': {
      border: 'none'
    }
  }
}));

export function SideBar() {
  const classes = useStyles();
  const user = useSelector(state => state.authentication.user.data.user)
  return (
    <Drawer
      className={classes.drawer}
      variant="permanent"
      classes={{
        paper: classes.drawerPaper,
      }}
    >
      <Toolbar />
<List>
  <ListItem button key={1}>
    <ListItemIcon>
      <Avatar src={user ? user.photo : null}></Avatar>
    </ListItemIcon>
    <ListItemText primary={user.firstname + " " + user.lastname} />
  </ListItem>
  <Divider></Divider>
  <ListItem button key={2} onClick={()=>history.push('/friend')}>
    <ListItemIcon>
      <EmojiPeopleIcon style={{ color: 'blue' }}></EmojiPeopleIcon>
    </ListItemIcon>
    <ListItemText primary={"Bạn bè"} />
  </ListItem>
  <ListItem button key={3}>
    <ListItemIcon>
      <SupervisedUserCircleIcon color='primary'></SupervisedUserCircleIcon>
    </ListItemIcon>
    <ListItemText primary={"Nhóm"} />
  </ListItem>
  <ListItem button key={4}>
    <ListItemIcon>
      <FavoriteIcon style={{ color: 'red' }}></FavoriteIcon>
    </ListItemIcon>
    <ListItemText primary={"Yêu thích"} />
  </ListItem>
  <ListItem button key={5} onClick={()=>history.push('/page')}>
    <ListItemIcon >
      <RestaurantOutlinedIcon style={{ color: 'green' }}></RestaurantOutlinedIcon>
    </ListItemIcon>
    <ListItemText primary={"Nhà hàng của tôi"} />
  </ListItem>
</List>
    </Drawer>
  );
}
